import React from "react";
import Navbar from "./navbar";
import Footer from "./footer";


function Challenges() {
    return(
        <>
        <Navbar />
            <h1>
                This is Challenges Page
            </h1>
        <Footer />
        </>
    )
}

export default Challenges;
